import React, { useEffect, useState } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Header from './Components/Header';
import Signup from './Components/Signup';
import Login from './Components/Login';
import Navbar from './Components/Navbar';
import { useAuthContext } from './hooks/useAuthContext';
import OwnerLogin from './Components/Owner/OwnerLogin';
import OwnerSignup from './Components/Owner/OwnerSignup';
import OwnerHome from './Components/Owner/OwnerHome';
import Home from './Components/Home';
// Import useLocation

function App() {
  const { user } = useAuthContext();
  const [check, setCheck] = useState(null);
  const location = window.location.href // Use useLocation to access the current location

  useEffect(() => {
    if (user?.types === "owner") {
      setCheck("owner");
    } else if (user?.types === "user") {
      setCheck("user");
    }
  }, [user?.types]);

  //console.log(location.pathname); // Log the current URL path

  return (
    <BrowserRouter>
      <Navbar />

      <Routes>
        <Route path="/" element={<Header />} />
        <Route path="/Login" element={<Login />} />
        <Route path="/Signup" element={<Signup />} />
        <Route path="/OwnerLogin" element={<OwnerLogin />} />
        <Route path="/OwnerSignup" element={<OwnerSignup />} />
        <Route path="/Home" element={<Home />} />
        <Route path="/OwnerHome" element={<OwnerHome />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
